package kr.springboot.gg.study.base64;

import java.io.File;
import java.io.FileInputStream;
import java.io.FileNotFoundException;
import java.io.IOException;
import java.util.Base64;

public class ImageToBase64String {

    public static void main(String[] args) throws IOException {

        File image = new File("/Users/jinulee/Documents/study2/gg/src/main/java/kr/springboot/gg/study/base64/1654957427.jpg");
        FileInputStream input = new FileInputStream(image);
        String base64String = Base64.getEncoder().encodeToString(input.readAllBytes());
        System.out.println(base64String);
        /**
         * Result
         * 
         */

    }

}
